@Override
public boolean equals(Object other_) {
  if (other_ == this) {
    return true;
  } else if (!(other_ instanceof TempTermOutputs.TempMetaData)) {
    return false;
  }
  TempMetaData other = (TempMetaData) other_;
  return statsEqual(this, other) && 
         longsEqual(this, other) && 
         bytesEqual(this, other);

}

